import React from 'react';

const tours = [
  {
    id: 1,
    title: 'Tour 1',
    description: 'This is Tour 1 information.',
    // additional properties
  },
  {
    id: 2,
    title: 'Tour 2',
    description: 'This is Tour 2 information.',
    // additional properties
  },
  // more tour objects
];

const getClickedCardInfo = (id) => {
  // Filter the tours array to find the tour object with the matching ID
  const clickedTour = tours.find(tour => tour.id === id);

  if (clickedTour) {
    // Return the information of the clicked card
    const { title, description } = clickedTour;
    return { title, description };
  } else {
    // Return an error message if the clicked ID does not exist
    return { error: 'Tour not found' };
  }
};

const TourCard = ({ id, title }) => {
  const handleClick = () => {
    // Call the getClickedCardInfo function with the clicked ID
    const clickedCardInfo = getClickedCardInfo(id);
    console.log(clickedCardInfo); // Example usage: Log the clicked card information
  };

  return (
    <div onClick={handleClick}>
      <h3>{title}</h3>
      {/* Render the rest of the tour card */}
    </div>
  );
};

export default TourCard;
